	add("tobacco", "{\"term\":\"tobacco\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Spanish\", \"taino\"], \"text\":\"Attested since 1588, a loan from Spanish \u0027tabaco\u0027 The Spanish word is either from Arabic \u0027طَبَاق\u0027 (a type of medicinal herb) also \u0027طُبَاق\u0027 \u0026lt;!-- (Spanish circa 1410, Arabic dating to 9th century)--\u0026gt; or from a Taino word meaning \u0026quot;roll of tobacco leaves\u0026quot;\u0026lt;ref\u0026gt;Las Casas, 1552 (supports the gloss \u0026quot;roll of tobacco leaves\u0026quot;)\u0026lt;/ref\u0026gt; or \u0026quot;a pipe for smoking tobacco\u0026quot;.\u0026lt;ref\u0026gt;Oviedo, 1535 (supports the gloss \u0026quot;pipe for smoking\u0026quot;)\u0026lt;/ref\u0026gt; The term is thus either an Old World term (of Arabic origin) applied to a New World plant, or a New World word.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the genus \u0027Nicotiana\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Leaves of \u0027Nicotiana tabacum\u0027 and some other species cultivated and harvested to make cigarettes, cigars, snuff, for smoking in pipes or for chewing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21584984-warning-bonds-linked-cigarette-sales-may-be-harmful-your-wealth-unlucky Unlucky passage\u003d\u0027\u0027Tobacco\u0027\u0027-settlement bonds are a tribute both to the inventiveness of bankers and the childlike impatience of politicians\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A variety of tobacco\", \"priority\":4}]}, \"synonyms\":{}}");

