	add("toboggan", "{\"term\":\"toboggan\", \"etymology\":{\"influencers\":[], \"languages\":[\"western abnaki\", \"English\", \"French\", \"mi\u0027kmaq\"], \"text\":\"The noun is attested since 1829, the verb since 1846. Both derive from French \u0027tabaganne\u0027 () which derives from an word, probably Mi\u0027kmaq \u0027tepaqan\u0027 () or Western abnaki \u0027dabôgan\u0027 () influenced by similar words in other Eastern Canadian Algonquian languages. The sense of \u0026quot;hat\u0026quot; is recorded since 1929 and is short for {{m|en|toboggan cap}} (1928), a cap suitable for wearing while tobogga. Verb|tobogganing.\u0026lt;ref\u0026gt;[http://www.word-detective.com/2009/10/toboggan/ Word Detective: toboggan]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long sled without runners, with the front end curled upwards, which may be pulled across snow by a cord or used to coast down hills\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027, John Russell Bartlett, \u0027Dictionary of Americanisms\u0027, second edition, enlarged\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Toboggan\u0027\u0027 has not yet found its Way into the dictionaries, and there are other ways of spelling it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, Louis Prosper Bender, \u0027Old and New Canada. 1753-1844: Historic Scenes and Social Pictures, Or, The Life of Joseph-Francois Perrault\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Nothing could be more exciting and exhilarating than a slide, on sleigh or \u0027\u0027toboggan\u0027\u0027, from the lofty summit of the ice-mound or cone down to its base\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027, Henry Chadwick, \u0027The Sports and Pastimes of American Boys: A Guide and Text-book of Games of the Play-ground, the Parlor, and the Field Adapted Especially for American Youth\u0027 (G. Routledge and sons), [http://books.google.com/books?id\u003dVUMFAAAAYAAJ\u0026amp;pg\u003dPA201\u0026amp;dq\u003dtobogganing\u0026amp;lr\u003d\u0026amp;as_brr\u003d0\u0026amp;as_pt\u003dALLTYPES\u0026amp;ei\u003dFmp_SaWlKKWwMpy32YY\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"PPA201,M1 page 201\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The “\u0027\u0027toboggan\u0027\u0027” is a light flat sleigh, used by the Canadian aborigines to bring home over the snow the spoils of the hunt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, A. T. Tucker (Alfred Thomas Tucker) Wise, \u0027Alpine Winter in Its Medical Aspects: With Notes on Davos Platz, Wiesen, St. Moritz, and the Maloja\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027toboggan\u0027\u0027 may be described as a flat plank turned up at one end\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027, Marjory Kennedy-Fraser, David Kennedy, \u0027David Kennedy: The Scottish Singer : Reminiscences of His Life and Work\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027toboggan\u0027\u0027 consists of two pieces of bark joined side by side and curved up at the front\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Charles A. Bramble, “Winter Fishing Through the Ice”, in \u0027The Sportsman\u0027s Magazine\u0027, [http://books.google.com/books?id\u003d308QAAAAYAAJ\u0026amp;pgis\u003d1 page 430\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Every half hour or so one or the other would steal off with snowshoes and \u0027\u0027toboggan\u0027\u0027 to make the round of the holes, often returning with half a dozen fish that together weighed perhaps twelve pounds, perhaps twenty-four pounds; . . \", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Rita Tregellas Pope, \u0027Landmark Visitors Guide Cornwall \u0026amp; the Isles of Scilly\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Trenance Park has gardens, a \u0027\u0027toboggan\u0027\u0027 run, miniature golf and the indoor delights of Water World with its tropical fun pool and flumes\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A similar sled of wood, pulled by dogs, possibly with steel runners, made to transport cargo\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, Abraham Gesner, \u0027New Brunswick; with Notes for Emigrants: Comprehending the Early History, an Account of the Indians, Settlement, Topography, Statistics, Commerce, Timber, Manufactures, Agriculture, Fisheries, Geology, Natural History, Social and Political State, Immigrants, and Contemplated Railways of that Province\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The old \u0027\u0027toboggan\u0027\u0027 has been laid aside, and sleighs or waggons dash along the streets\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, John G. Donkin, \u0027Trooper and Redskin in the Far North-west: Recollections of Life in the North-west Mounted Police\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"These animals are harnessed by a padded collar to a light flat sleigh, of skins stretched across a frame of thin wood, called a \u0027\u0027toboggan\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"lt;!--and maybe broader Mid-Atlantic?--\u0026gt; A winter hat or ski mask\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, William Rush Dunton, \u0027Occupation therapy\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Suppose we wish to make a pointed cap, such as used to be known as a \u0027\u0027toboggan\u0027\u0027 cap, from yarn or worsted\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Wallace Neal Briggs, \u0027Riverside Remembered\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Sissy bounded back in dressed in a heavy sweater and \u0027\u0027toboggan\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Dave Smith, \u0027Life\u0027s Too Short to Be an Underdog...And Other Spiritual Life Lessons I Learned from My Dog\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"If you must adorn your dog with a hat, go with a \u0027\u0027toboggan\u0027\u0027-style hat. If It was good enough for Snoopy, It Is definitely good enough for your dog\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Cornelius Osgood, \u0027Winter\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"The steer dog next to the sleigh prevents this by immediately leading off at a sixty-degree angle from the direction the others are going, thereby compensating for the sidewise stress and keeping the \u0027\u0027toboggan\u0027\u0027 in the clear until the bend has been passed\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Frances Stegall, \u0027Grass Roots: 80 Years in Bailey Co\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"We used an old \u0027\u0027toboggan\u0027\u0027 stuffed with cotton for the ball, and it served the purpose very well\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"Something which, once it starts go going (figuratively) downhill, is unstoppable until it reaches the bottom\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, Joe Vila, \u0027The Sporting News\u0027, read in Gordon H. Fleming, \u0027The Unforgettable Season\u0027 (2006\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"McGinnity began to hit the \u0027\u0027toboggan\u0027\u0027 in 1906, after he had pitched his arm off the previous year. Last season his efforts at times were painful\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"1948\u0027\u0027, U.S. House of Representatives, \u0027Hearing before the Committee on Banking and Currency, on S.J. Res. 157, joint resolution to aid in protecting the Nation\u0027s economy against inflationary pressures. 80th Congress, 2nd Session July 29-August 4, 1948\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"If we were to hit the \u0027\u0027toboggan\u0027\u0027 of a depression, wages would drop\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, C.W. Peterson, \u0027Wake Up, Canada!: Reflections on Vital National Issues\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"Farming was on “the \u0027\u0027toboggan\u0027\u0027.” New settlers who had purchased land could not meet their deferred payments\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Jim Harrison, \u0027Off to the Side\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"The fact that I agreed showed that there was no hope of getting off the \u0027\u0027toboggan\u0027\u0027 more than momentarily\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Richard Allan (EDT) Davison, \u0027The Art of the American Musical: Conversations with the Creators\", \"priority\":42},{\"upperType\":\"NOUN\", \"text\":\"We all have found out that once a show goes into rehearsal, it\u0027s a \u0027\u0027toboggan\u0027\u0027 slide and there\u0027s not enough time. So we had six months of preproduction meetings\", \"priority\":43}]}, \"synonyms\":{}}");

